node.text:
@ohhappydani makes me damn happy. Dani is an incredible illustrator, artist, change maker and after many smooth DMs, is now a friend of mine. I am one of thousands who are drawn to her light, and love the way her mind envisions messages the world needs to hear. Her art speaks beautifully for itself, but listen in to hear Dani speak of her start, her story and how she's finding her stride in her success. Thank you internet for introducing me to talented friends... Fangirl over @ohhappydani with me, and show her some love today.

Illustrations by: @ohhappydani ✍🏾
🎥✂️👑: @malarkeymike
